import {
   useEffect
 } from 'react';
import $ from 'jquery';
import {
  Button,
  Container,
  Card
} from "react-bootstrap";
 const Http = ()=>{
   const fetchData = ()=>{
     $.ajax({
       type: 'GET',
       url: 'http://localhost:3232',
       success: function(response){
         console.log(response);
       }
     });
   }
   useEffect(()=>{
     fetchData();
   });


  const design = (
    <>
    <Container className="py-4">
      <div className='d-flex justify-content-between mb-4'>
        <div>
          <h2>Comments</h2>
        </div>
        <div>
          <Button variant='success'>New Comment</Button>
        </div>
      </div>
      <Card>
        <Card.Header>Featured</Card.Header>
        <Card.Body>
          <h1>Craad body</h1>
        </Card.Body>
      </Card>
    </Container>
    </>
  );
  return design;
}

export default Http;
